              "/* --------------------------------- GLOBAL --------------------------------- */\n@import '../assets/icons/bootstrap-icons/font/bootstrap-icons.css';\n@import '../assets/icons/fontawesome-free-6.0.0-web/css/all.css';\n\n@font-face {\n  font-family: Graphik;\n  src: url(../assets/fonts/Graphik-Font-Family/GraphikLight.otf);\n}\n\n@font-face {\n  font-family: Graphik-bold;\n  src: url(../assets/fonts/Graphik-Font-Family/GraphikSemibold.otf);\n}\n\n@font-face {\n  font-family: Blacklisted;\n  src: url(../assets/fonts/Blacklisted.ttf);\n}\n@font-face {\n  font-family: 'Font Awesome 6 Brands';\n  src: url(../assets/icons/fontawesome-free-6.0.0-web/webfonts/fa-brands-400.ttf);\n}\n\n@font-face {\n  font-family: 'Font Awesome 6 Free';\n  src: url(../assets/icons/fontawesome-free-6.0.0-web/webfonts/fa-solid-900.ttf);\n}\n\n:root {\n  --purple-main: rgb(160, 108, 213);\n  --purple-light: rgb(184, 147, 221);\n  --purple-dark: rgb(130, 71, 190);\n  --black-main: #141414;\n  --black-light: #252526;\n  --font: Graphik, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen,\n    Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;\n  --font-bold: Graphik-bold, -apple-system, BlinkMacSystemFont, 'Segoe UI',\n    Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;\n  --font-special: Blacklisted, -apple-system, BlinkMacSystemFont, 'Segoe UI',\n    Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;\n  --fa-font-brands: 'Font Awesome 6 Brands';\n  --fa-font-solid: 'Font Awesome 6 Free';\n}\n\n/* ------------------------------ GENERAL STYLE ----------------------------- */\n\nbody {\n  position: relative;\n  background-image: url('../assets/images/PolygonLuminary.svg');\n  background-size: cover;\n  color: white;\n  margin: 0;\n  padding: 0;\n}\n\nbody,\nbutton {\n  font-family: var(--font);\n}\n\nbutton {\n  background: rgba(130, 71, 190, 0.7);\n  color: white;\n  display: flex;\n  align-items: center;\n  justify-content: center;\n  border: 0;\n  padding: 1rem;\n  cursor: pointer;\n  transition: background 0.5s;\n}\n\nbutton:hover {\n  background: rgba(130, 71, 190, 1);\n}\n\nbutton:active {\n  background: rgb(184, 147, 221);\n}\n\nbutton.active {\n  border-bottom: 2px solid rgb(184, 147, 221);\n}\n\n.bi {\n  color: white;\n  font-size: 1.8rem;\n}\n\nul {\n  list-style: none;\n  padding: 0;\n}\n\n#blur-container {\n  background: rgba(0, 0, 0, 0);\n  width: 100vw;\n  height: 100vh;\n  position: absolute;\n  /* pointer-events: none; */\n  z-index: 0;\n  transition: background 0.5s;\n}\n\n#blur-container.blur {\n  background: rgba(0, 0, 0, 0.6);\n  z-index: 1;\n}\n\n#container {\n  position: relative;\n  min-height: 100vh;\n  display: grid;\n  grid-template-rows: auto 1fr auto;\n}\n\n/* ---------------------------------- HEADER -------------------------------- */\n\n.header {\n  background: rgba(130, 71, 190, 0.6);\n  display: grid;\n  grid-template-columns: 1fr auto;\n  align-items: center;\n  padding-left: 1rem;\n}\n\n.header .title {\n  font-size: 1.4rem;\n}\n\n.menu {\n  font-size: 1.2rem;\n  display: grid;\n  grid-template-columns: repeat(2, 1fr);\n}\n\n.menu button {\n  font-size: 1rem;\n  padding: 1rem 3rem;\n}\n\n/* ---------------------------------- FOOTER -------------------------------- */\n\n.footer {\n  background: rgba(130, 71, 190, 0.6);\n  font-size: 0.9rem;\n  display: flex;\n  place-content: center;\n  padding: 0.4rem;\n}\n\n/* --------------------------------- CONTENT -------------------------------- */\n\n.content {\n  background: rgba(130, 71, 190, 0.1);\n  padding: 1rem;\n}\n\n.crypto {\n  display: flex;\n  flex-direction: column;\n  gap: 1rem;\n}\n\n.crypto .search {\n  position: relative;\n  display: flex;\n}\n\n.crypto i {\n  position: absolute;\n  left: 1rem;\n  top: 50%;\n  transform: translateY(-50%);\n}\n\n.crypto .error {\n  position: absolute;\n  background: rgba(166, 66, 83, 0.8);\n  color: #ffffff;\n  top: 1rem;\n  right: 1rem;\n  padding: 0.6rem 2rem;\n  border-radius: 6px;\n  opacity: 0;\n  pointer-events: none;\n\n  transition: opacity 0.5s;\n}\n\n.crypto .error.active {\n  opacity: 1;\n}\n\n.crypto input[type='text'] {\n  background: rgba(130, 71, 190, 0.2);\n  color: #ffffff;\n  caret-color: #ffffff;\n  font-family: var(--font);\n  border: 0;\n  border-radius: 6px;\n  padding: 0.5rem 0.5rem 0.5rem 3rem;\n  width: 100%;\n\n  transition: padding 0.5s;\n}\n\n.crypto input[type='text']::placeholder {\n  color: #ffffff;\n  opacity: 0.5;\n}\n\n.crypto input[type='text']:focus {\n  padding: 0.7rem 0.7rem 0.7rem 3rem;\n}\n\n.crypto .assets-table {\n  background: rgba(130, 71, 190, 0.1);\n  display: grid;\n\n  border: 0.01rem solid rgba(160, 108, 213, 0.3);\n  border-radius: 6px;\n}\n\n.crypto #result .assets-table {\n  display: none;\n}\n\n.crypto .assets-table > .table-title {\n  font-family: var(--font);\n  font-size: 1.2rem;\n  padding: 1rem 2rem;\n  display: flex;\n  justify-content: space-between;\n}\n\n.crypto .assets-table > .table-title select {\n  background: rgba(160, 108, 213, 0.3);\n  color: #ffffff;\n  font-family: var(--font);\n  border: 0;\n  border-radius: 6px;\n  padding: 0.3rem;\n}\n\n.crypto .assets-table > .table-header > * {\n  opacity: 0.5;\n}\n\n.crypto .assets-table > .table-content {\n  display: grid;\n}\n\n.crypto .assets-table > .table-header,\n.crypto .assets-table > .table-content > .table-item {\n  display: grid;\n  grid-template-columns: 6ch 1fr 1fr 1fr 1fr;\n  align-items: center;\n  padding: 1rem 2rem;\n  border-top: 0.01rem solid rgba(160, 108, 213, 0.3);\n}\n\n.crypto .assets-table > .table-content > .table-item:hover {\n  cursor: pointer;\n  background: rgba(160, 108, 213, 0.3);\n}\n\n.crypto .assets-table > .table-content > .table-item > .table-item-currency {\n  display: grid;\n  grid-template-areas:\n    'currency-icon currency-name'\n    'currency-icon currency-shortcut';\n  justify-self: start;\n  align-items: center;\n  gap: 0 1rem;\n}\n\n.table-item > .table-item-currency > .table-item-currency-icon {\n  grid-area: currency-icon;\n}\n\n.table-item > .table-item-currency > .table-item-currency-name {\n  grid-area: currency-name;\n}\n\n.table-item > .table-item-currency > .table-item-currency-shortcut {\n  grid-area: currency-shortcut;\n}\n\n.table-item > div > div:nth-child(2) {\n  opacity: 0.5;\n}\n\n.table-item > .table-item-variation {\n  color: rgb(97, 201, 97);\n}\n",
